                  <div class="shop__info">
                    <div class="info__header clearfix">
                      <div class="info__logo-wrap">
                        <a href="{{url}}" title="{{name}}" class="info__logo-anchor" target="_blank">
                          {{#if shopPic}}
                          <img src="{{shopPic}}" alt="{{name}}" class="info__logo" height="40" width="40">
                          {{else}}
                          <img src="//img.alicdn.com/tps/i2/T1jGS6Xl8aXXXXXXXX-70-70.gif_40x40.jpg" alt="{{name}}" class="info__logo" height="40" width="40">
                          {{/if}}
